tinymce.PluginManager.add("filemanager",function(a){function e(){var t=a.dom;$.fn.upload_filemanager({selected:function(e){var n={href:e.url,target:"_blank",rel:null,"class":null,title:e.name};a.insertContent(t.createHTML("a",n,t.encode(e.name)))}})}a.addButton("filemanager",{icon:"browse",tooltip:"Insert file",onclick:e,stateSelector:"img:not([data-mce-object])"}),a.addMenuItem("filemanager",{icon:"browse",text:"Insert file",onclick:e,context:"insert",prependToContext:!0})});